// MessageList.js

import MessageItem from './MessageItem';

const MessageList = ({ messages }) => {
    return (
        <div className="message-list">
            {messages.map((msg, index) => (
                <MessageItem key={index} message={msg} isOwnMessage={msg.isOwnMessage} />
            ))}
        </div>
    );
};

export default MessageList;
